    super(props)
  
    this.state = {
       initialBoard: [],
       finalBoard: [],
       level: null
    }
  }

  componentWillMount(){
    const { id } = this.props.match.params;
    console.log(id);
    axios
    .get(`/api/sudokus/${id}`)
    .then(res => {
      console.log(res.data);
